(92, 1, ' <div id=\"wrap_id_advice_1544548911778\"> <section id=\"0_PrestaShop Ads\" class=\"panel\" style=\"display:none\"> <header class=\"panel-heading\"> <span class=\"icon-lightbulb\"></span> Conseil du jour </header> <div class=\"panel-body\" style=\"padding:0\"> <img class=\"img-responsive\" src=\"https://storage.googleapis.com/production-gamification-assets/tips/PrestaShop Ads.png\" style=\"float:right; margin-left: 5px;\"> <img src=\"https://gamification.prestashop.com/api/getAdviceImg/1544548911778.png\"/> <p> <b>Augmentez vos ventes sur Google Shopping avec la solution marketing de PrestaShop !</b> </p> <p> Le module PrestaShop Ads est la solution en un clic pour la publicité sur Google Shopping. Création de campagne, comparaison des prix et contrôle des concurrents. Gratuit. </p> <span class=\"text-right\" style=\"float:right\"> <a class=\"btn btn-default\" target=\"_blank\" href=\"https://gamification.prestashop.com/get_advice_link.php?id_advice=1544548911778&url=https://addons.prestashop.com/fr/referencement-payant-affiliation/18716-prestashop-ads.html%3Futm_source%3Dback-office%26utm_medium%3Dtipoftheday%26utm_campaign%3Dpartenariats%26utm_content%3DPrestaShop Ads\"> Commencer ici </a> </span> </div> </section><script> $(document).ready( function () { $(\'#\'+rand(0)+\'_PrestaShop Ads\').show(); }); function rand(nbr){ return Math.floor(Math.random()*(nbr+1)); } </script> </div>'),
(93, 1, ' <div id=\"wrap_id_advice_1571833839772\"> <section id=\"0_PrestaShop Checkout\" class=\"panel\" style=\"display:none\"> <header class=\"panel-heading\"> <span class=\"icon-lightbulb\"></span> Conseil du jour </header> <div class=\"panel-body\" style=\"padding:0\"> <img class=\"img-responsive\" src=\"https://storage.googleapis.com/production-gamification-assets/tips/PrestaShop Checkout.png?1571837750282\" style=\"float:right; margin-left: 5px;\"> <img src=\"https://gamification.prestashop.com/api/getAdviceImg/1571833839772.png\"/> <p> <b>Avec PrestaShop Checkout, gérez vos paiements en toute simplicité</b> </p> <p> Acceptez et gérez toutes les méthodes de paiement (cartes de crédit, PayPal, méthodes de paiement locales) à partir d\'un seul module, directement depuis le back-office de PrestaShop </p> <span class=\"text-right\" style=\"float:right\"> <a class=\"btn btn-default\" target=\"_blank\" href=\"https://gamification.prestashop.com/get_advice_link.php?id_advice=1571833839772&url=https://addons.prestashop.com/fr/paiement-carte-wallet/46347-prestashop-checkout-built-with-paypal.html?utm_source=BO-visibility&utm_medium=tips-BO&utm_campaign=ps-checkout&utm_content=fr%3Futm_source%3Dback-office%26utm_medium%3Dtipoftheday%26utm_campaign%3Dpartenariats%26utm_content%3DPrestaShop Checkout\"> Découvrir PrestaShop Checkout </a> </span> </div> </section><script> $(document).ready( function () { $(\'#\'+rand(0)+\'_PrestaShop Checkout\').show(); }); function rand(nbr){ return Math.floor(Math.random()*(nbr+1)); } </script> </div>'),
(94, 1, ' <div id=\"wrap_id_advice_1590565917076\"> <section id=\"0_Société des avis garantis \" class=\"panel\" style=\"display:none\"> <header class=\"panel-heading\"> <span class=\"icon-lightbulb\"></span> Conseil du jour </header> <div class=\"panel-body\" style=\"padding:0\"> <img class=\"img-responsive\" src=\"https://storage.googleapis.com/production-gamification-assets/tips/Société des avis garantis .png?1590566304044?1609920215266\" style=\"float:right; margin-left: 5px;\"> <img src=\"https://gamification.prestashop.com/api/getAdviceImg/1590565917076.png\"/> <p> <b>94% des avis clients que nous récoltons sont positifs</b> </p> <p> La Société des Avis Garantis récolte et affiche les avis de vos clients. Notre module vous permettra de booster vos conversions et donc vos ventes. </p> <span class=\"text-right\" style=\"float:right\"> <a class=\"btn btn-default\" target=\"_blank\" href=\"https://gamification.prestashop.com/get_advice_link.php?id_advice=1590565917076&url=https://addons.prestashop.com/fr/avis-clients/29150-avis-clients-societe-des-avis-garantis.html%3Futm_source%3Dback-office%26utm_medium%3Dtipoftheday%26utm_campaign%3Dpartenariats%26utm_content%3DSociété des avis garantis \"> En savoir plus </a> </span> </div> </section><script> $(document).ready( function () { $(\'#\'+rand(0)+\'_Société des avis garantis \').show(); }); function rand(nbr){ return Math.floor(Math.random()*(nbr+1)); } </script> </div>'),
(95, 1, ' <div id=\"wrap_id_advice_823\"> <section id=\"0_amzpayments\" class=\"panel\" style=\"display:none\"> <header class=\"panel-heading\"> <span class=\"icon-lightbulb\"></span> Conseil du jour </header> <div class=\"panel-body\" style=\"padding:0\"> <img class=\"img-responsive\" src=\"https://storage.googleapis.com/production-gamification-assets/tips/amzpayments.png?1588671011611?1588671118467?1588671200581?1588671429187?1588671449336\" style=\"float:right; margin-left: 5px;\"> <img src=\"https://gamification.prestashop.com/api/getAdviceImg/823.png\"/> <p> <b>Savez vous que 8 clients sur 10 change de marque s\'il ne lui font pas confiance?</b> </p> <p> Avec Amazon Pay, vos clients peuvent profiter d\'une expérience d\'achat en laquelle ils ont confiance; en utilisant les informations de paiement déjà stockées dans leur compte Amazon. </p> <span class=\"text-right\" style=\"float:right\"> <a class=\"btn btn-default\" target=\"_blank\" href=\"https://gamification.prestashop.com/get_advice_link.php?id_advice=823&url=https://addons.prestashop.com/fr/paiement-carte-wallet/21293-amzpayments.html%3Futm_source%3Dback-office%26utm_medium%3Dtipoftheday%26utm_campaign%3Dpartenariats%26utm_content%3Damzpayments\"> En savoir plus </a> </span> </div> </section><script> $(document).ready( function () { $(\'#\'+rand(0)+\'_amzpayments\').show(); }); function rand(nbr){ return Math.floor(Math.random()*(nbr+1)); } </script> </div>');
