(54, 1, 'alors|au|aucuns|aussi|autre|avant|avec|avoir|bon|car|ce|cela|ces|ceux|chaque|ci|comme|comment|dans|des|du|dedans|dehors|depuis|deux|devrait|doit|donc|dos|droite|début|elle|elles|en|encore|essai|est|et|eu|fait|faites|fois|font|force|haut|hors|ici|il|ils|je|juste|la|le|les|leur|là|ma|maintenant|mais|mes|mine|moins|mon|mot|même|ni|nommés|notre|nous|nouveaux|ou|où|par|parce|parole|pas|personnes|peut|peu|pièce|plupart|pour|pourquoi|quand|que|quel|quelle|quelles|quels|qui|sa|sans|ses|seulement|si|sien|son|sont|sous|soyez|sujet|sur|ta|tandis|tellement|tels|tes|ton|tous|tout|trop|très|tu|valeur|voie|voient|vont|votre|vous|vu|ça|étaient|état|étions|été|être', NULL),
(80, 1, 'Cher Client,\r\n\r\nCordialement,\r\nL\'équipe Boc\'O Drive', '2021-02-08 11:33:20'),
(280, 1, '<h2 style=\"line-height:normal;\"><span style=\"font-family:Arial, \'sans-serif\';\">Boc\'O Drive : Zéro déchet est en cours de construction , Merci de votre patience ! </span></h2>\n<h2 style=\"line-height:normal;\"><span style=\"font-family:Arial, \'sans-serif\';\"></span></h2>\n<h2 style=\"line-height:normal;\"><span style=\"font-family:Arial, \'sans-serif\';\">L’idée</span></h2>\n<p class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-family:Arial, \'sans-serif\';\">L\'idée, c\'est de proposer la qualité des produits d\'un magasin vrac bio, l\'offre locale d\'un magasin de producteurs et le service d\'un drive ! F<span style=\"color:#1B1B1B;background:#FFFFFF;\">aire ses courses rapidement, de manière raisonnée tout en profitant de produits sains, sans emballages superflus, et le tout sans dépasser le budget initial.</span></span></p><p></p>\n<p class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-family:Arial, \'sans-serif\';\">Changeons nos habitude de consommation allons vers un monde sans plastique (zéro déchet)</span></p><p></p>\n<p class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-family:Arial, \'sans-serif\';\">Vendre des produits sains de haute qualité locaux, bio, de saison, tout cela dans des contenants consignés.</span></p><p></p>\n<p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent:-18pt;line-height:normal;\"><!-- [if !supportLists]--><span style=\"font-family:Symbol;\"><span>·<span style=\"font:7pt \'Times New Roman\';\">         </span></span></span><!--[endif]--><span style=\"font-family:Arial, \'sans-serif\';\">Du bio, pour la santé des Hommes et de la planète</span></p><p></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-18pt;line-height:normal;\"><!-- [if !supportLists]--><span style=\"font-family:Symbol;\"><span>·<span style=\"font:7pt \'Times New Roman\';\">         </span></span></span><!--[endif]--><span style=\"font-family:Arial, \'sans-serif\';\">Du local, pour soutenir les producteurs d’ici</span></p><p></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-18pt;line-height:normal;\"><!-- [if !supportLists]--><span style=\"font-family:Symbol;\"><span>·<span style=\"font:7pt \'Times New Roman\';\">         </span></span></span><!--[endif]--><span style=\"font-family:Arial, \'sans-serif\';\">Du vrac, pour participer à la réduction des déchets</span></p><p></p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"text-indent:-18pt;line-height:normal;\"><!-- [if !supportLists]--><span style=\"font-family:Symbol;\"><span>·<span style=\"font:7pt \'Times New Roman\';\">         </span></span></span><!--[endif]--><span style=\"font-family:Arial, \'sans-serif\';\">La fabrication de ses produits soi-même.</span></p><p></p>\n<h2 style=\"margin-top:11.25pt;margin-right:0cm;margin-bottom:11.25pt;margin-left:0cm;line-height:21.45pt;background:#FFFFFF;\"><span style=\"font-size:11pt;font-family:Arial, \'sans-serif\';\">Lutter contre le gâchis et la surconsommation</span></h2><p></p>\n<p class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-family:Arial, \'sans-serif\';\">Les produits sont majoritairement en vrac. Vous choisissez ce dont vous avez besoin, on vous préemballe vos commandes dans des bocaux en verre, réutilisables et consignés. On oublie le gâchis et la surconsommation, on oublie aussi les emballages plastiques ou cartonnés qui saturent nos poubelles (590 kg/an).</span></p><p></p>\n<p class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-family:Arial, \'sans-serif\';\">Pour réduire l’empreinte carbone liée aux transports des marchandises, on privilégie les circuits courts et les produits alimentaires.</span></p><p></p>', '2021-02-07 10:13:57'),
(282, 1, '', NULL),
(283, 1, '', NULL),
