(205, 1, 'UNE HISTOIRE DE FAMILLE ET LA PASSION DU GOÛT.Garants de notre savoir-faire artisanal, nos procédés de fabrication sont quant à eux empruntés aux chocolatiers pâtissiers. Après un pré-broyage, les fruits secs sont cuits au poêlon puis refroidis par un ratissage manuel et régulier du praliné cuit, avant d’être enfin brassés à basse température dans une conche avec l’ensemble des ingrédients pendant une période allant de 17 à 24 heures. Parfaitement maîtrisés, ces procédés traditionnels donnent à nos pâtes à tartiner leur texture lisse et onctueuse, restituant harmonieusement le goût des fruits secs torréfiés tout en exaltant leur arôme.', 'Noiseraie', '', ''),
(206, 1, 'Teo &amp; Bia est une entreprise artisanale basée dans une petite vallée de San Salvatore Monferrato, Nord de l\'Italie. On y créé des produits délicats assemblant des ingrédients gourmands, cultivés dans le respect de l’environnement et du consommateur. Alors, vous ne trouverez ni lait, ni lécithine de soja, ni gluten, mais uniquement une sélection avisée d\'ingrédients bio !', 'Teo & Bia', '', ''),
(207, 1, 'Contribuer à l’émergence d’une société zéro-déchet : telle est la vision de Jean Bouteille, qui associe la vente en vrac de liquides à la bouteille réutilisable et consignée pour permettre aux consommateurs d’acheter des produits liquides sans générer de déchets !', 'jean Bouteille', '', '');
